import React from 'react'
import '../styles/Navbar.css';
import { Link } from 'react-router-dom';
// import logo from '../data/data.json';
import { searchIcon } from '../icons/icons';

const newlogo = "https://i01.appmifile.com/webfile/globalimg/pandora/mi-logo.svg";

const Navbar = () => {
    return (
        <div className="nav">
            <div className="logo">
                <Link to="/">
                    <img id="logoimage" src={newlogo} alt="Logo" />
                </Link>

                <Link className="navlinks" to="/miphones">Xiaomi Phones</Link>
                <Link className="navlinks" to="/redmiphones">Redmi Phones</Link>
                <Link className="navlinks" to="/tv">TV</Link>
                <Link className="navlinks" to="/laptops">Laptops</Link>
                <Link className="navlinks" to="/fitness">Fitness</Link>
                <Link className="navlinks" to="/home">Home</Link>
                <Link className="navlinks" to="/audio">Audio</Link>
                <Link className="navlinks" to="/accessories">Accessories</Link>

                <div className="searchbox">
                    <input type="text" name="search" placeholder="Search Product" />
                    {searchIcon}

                </div>
            </div>
        </div>
    )
}

export default Navbar
